import React from 'react';
import { Row, Col } from "react-bootstrap";

function Footer() {
  return (
    <>
      <div className="lineBox">
      <div className="line"></div>
      {/* eslint-disable-next-line */}
      <div className="lineText"><a className="link" href="https://openweathermap.org/" target="_blank">openweathermap.org</a></div>
    </div>

    <div className="footer-style">2022 &#9827; Angelo Fantino</div>
    </>    
  )
}

export default Footer
